// pages/Contact.js
import React from 'react';

function Contact() {
  return (
    <div>
      <h1>Contact Us</h1>
      <p>Email: henryain4@gmail.com</p>
      <p>Phone: +2348050351011</p>
      <p>Address: 123 BMW Street,  City, Country</p>
    </div>
  );
}
export default Contact;
